import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'; // Подключаем стили  

function Header() {
  return (
    <header style={headerStyle}>
      <nav>
        <ul style={navListStyle}>
          <li style={navItemStyle}><Link to="/" style={linkStyle}>Главная</Link></li>
          <li style={navItemStyle}><Link to="/admin" style={linkStyle}>Админ-панель</Link></li>
          <li style={navItemStyle}><Link to="/calculator/mortgage" style={linkStyle}>Ипотечный калькулятор</Link></li>
        </ul>
      </nav>
    </header>
  );
}

const headerStyle = {
  backgroundColor: '#333',
  padding: '10px 0',
  textAlign: 'center',
};

const navListStyle = {
  listStyle: 'none',
  padding: 0,
  margin: 0,
};

const navItemStyle = {
  display: 'inline',
  margin: '0 15px',
};

const linkStyle = {
  color: 'white',
  textDecoration: 'none',
  fontSize: '18px',
};

export default Header;
